function get_class_name_by_id(id) {
    const item = id_to_classname.find(item => item.id === id);
    if (item) {
        const name = item.name;
        const firstCommaIndex = name.indexOf(','); // 获取第一个逗号的索引
        if (firstCommaIndex !== -1) {
            const secondCommaIndex = name.indexOf(',', firstCommaIndex + 1); // 获取第二个逗号的索引
            let suffix;
            if (secondCommaIndex !== -1) {
                suffix = name.substring(firstCommaIndex + 1, secondCommaIndex).trim(); // 提取第一个逗号和第二个逗号之间的内容并去除首尾空格
            } else {
                suffix = name.substring(firstCommaIndex + 1).trim(); // 如果没有找到第二个逗号，则提取第一个逗号后的所有内容并去除首尾空格
            }
            const prefix = name.substring(0, firstCommaIndex).trim(); // 提取第一个逗号前的内容并去除首尾空格
            return `${suffix}（${prefix}）`; // 将前缀用括号括起来加到后缀的后面返回
        } else {
            return name; // 如果没有找到逗号，则直接返回原始字符串
        }
    }
    return "unknown";
}
